INSERT INTO `wp_posts` VALUES (10,1,'2023-09-02 18:57:29','2023-09-02 18:57:29','<!-- wp:template-part {\"slug\":\"header\",\"theme\":\"keily\"} /-->\n\n<!-- wp:group {\"tagName\":\"main\",\"style\":{\"color\":{\"background\":\"#effbf8\"}},\"layout\":{\"type\":\"constrained\",\"contentSize\":\"1320px\",\"wideSize\":\"100%\"}} -->\n<main class=\"wp-block-group has-background\" style=\"background-color:#effbf8\"><!-- wp:group {\"style\":{\"spacing\":{\"blockGap\":\"0\",\"padding\":{\"top\":\"var:preset|spacing|80\",\"right\":\"0\",\"bottom\":\"var:preset|spacing|80\",\"left\":\"0\"}},\"color\":{\"background\":\"#effbf8\"}},\"layout\":{\"type\":\"constrained\",\"contentSize\":\"\",\"wideSize\":\"\"}} -->\n<div class=\"wp-block-group has-background\" style=\"background-color:#effbf8;padding-top:var(--wp--preset--spacing--80);padding-right:0;padding-bottom:var(--wp--preset--spacing--80);padding-left:0\"><!-- wp:columns -->\n<div class=\"wp-block-columns\"><!-- wp:column {\"verticalAlignment\":\"center\",\"width\":\"60%\",\"style\":{\"spacing\":{\"padding\":{\"right\":\"0\",\"top\":\"0\",\"bottom\":\"0\",\"left\":\"0\"}}},\"className\":\"is-style-default\"} -->\n<div class=\"wp-block-column is-vertically-aligned-center is-style-default\" style=\"padding-top:0;padding-right:0;padding-bottom:0;padding-left:0;flex-basis:60%\"><!-- wp:group {\"align\":\"wide\",\"style\":{\"spacing\":{\"padding\":{\"top\":\"0\",\"right\":\"0\",\"bottom\":\"0\",\"left\":\"0\"},\"margin\":{\"top\":\"0\",\"bottom\":\"0\"}}},\"layout\":{\"type\":\"constrained\"}} -->\n<div class=\"wp-block-group alignwide\" style=\"margin-top:0;margin-bottom:0;padding-top:0;padding-right:0;padding-bottom:0;padding-left:0\"><!-- wp:heading {\"style\":{\"typography\":{\"fontSize\":\"68px\"}}} -->\n<h2 class=\"wp-block-heading\" style=\"font-size:68px\"><strong>Hi. I am Desiree Villasmil</strong></h2>\n<!-- /wp:heading -->\n\n<!-- wp:group {\"layout\":{\"type\":\"constrained\",\"justifyContent\":\"left\",\"contentSize\":\"600px\",\"wideSize\":\"100%\"}} -->\n<div class=\"wp-block-group\"><!-- wp:paragraph {\"style\":{\"typography\":{\"lineHeight\":\"1.8\"},\"spacing\":{\"margin\":{\"bottom\":\"var:preset|spacing|60\"}},\"color\":{\"text\":\"#55527c\"}},\"fontSize\":\"small\",\"fontFamily\":\"work-sans\"} -->\n<p class=\"has-text-color has-work-sans-font-family has-small-font-size\" style=\"color:#55527c;margin-bottom:var(--wp--preset--spacing--60);line-height:1.8\">I am a Florida based computer engineer, with more than five years of experience, with strong problem solving skills, attention to<br>detail, and the ability to work independently and collaboratively.</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:group --></div>\n<!-- /wp:group -->\n\n<!-- wp:columns {\"style\":{\"spacing\":{\"padding\":{\"top\":\"0\",\"right\":\"0\",\"bottom\":\"0\",\"left\":\"0\"},\"margin\":{\"top\":\"0\",\"bottom\":\"0\"}}}} -->\n<div class=\"wp-block-columns\" style=\"margin-top:0;margin-bottom:0;padding-top:0;padding-right:0;padding-bottom:0;padding-left:0\"><!-- wp:column {\"width\":\"100%\",\"style\":{\"spacing\":{\"padding\":{\"top\":\"0\",\"right\":\"0\",\"bottom\":\"0\",\"left\":\"0\"}}},\"layout\":{\"type\":\"default\"}} -->\n<div class=\"wp-block-column\" style=\"padding-top:0;padding-right:0;padding-bottom:0;padding-left:0;flex-basis:100%\"><!-- wp:group {\"layout\":{\"type\":\"constrained\",\"contentSize\":\"100%\"}} -->\n<div class=\"wp-block-group\"><!-- wp:group {\"layout\":{\"type\":\"constrained\"}} -->\n<div class=\"wp-block-group\"><!-- wp:heading {\"level\":5,\"fontSize\":\"xsmall\"} -->\n<h5 class=\"wp-block-heading has-xsmall-font-size\"><strong>Full Name</strong></h5>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"style\":{\"typography\":{\"fontSize\":\"0.88rem\"}},\"fontFamily\":\"work-sans\"} -->\n<p class=\"has-work-sans-font-family\" style=\"font-size:0.88rem\">Desiree Villasmil</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:group --></div>\n<!-- /wp:group --></div>\n<!-- /wp:column -->\n\n<!-- wp:column {\"width\":\"100%\"} -->\n<div class=\"wp-block-column\" style=\"flex-basis:100%\"><!-- wp:group {\"layout\":{\"type\":\"constrained\",\"contentSize\":\"100%\"}} -->\n<div class=\"wp-block-group\"><!-- wp:group {\"layout\":{\"type\":\"constrained\",\"contentSize\":\"100%\"}} -->\n<div class=\"wp-block-group\"><!-- wp:group {\"layout\":{\"type\":\"constrained\"}} -->\n<div class=\"wp-block-group\"><!-- wp:heading {\"level\":5,\"fontSize\":\"xsmall\"} -->\n<h5 class=\"wp-block-heading has-xsmall-font-size\"><strong><strong>Address</strong></strong></h5>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"style\":{\"typography\":{\"fontSize\":\"0.88rem\"}},\"fontFamily\":\"work-sans\"} -->\n<p class=\"has-work-sans-font-family\" style=\"font-size:0.88rem\">Orlando, FL</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:group --></div>\n<!-- /wp:group --></div>\n<!-- /wp:group --></div>\n<!-- /wp:column -->\n\n<!-- wp:column {\"width\":\"100%\"} -->\n<div class=\"wp-block-column\" style=\"flex-basis:100%\"><!-- wp:group {\"layout\":{\"type\":\"constrained\",\"contentSize\":\"100%\"}} -->\n<div class=\"wp-block-group\"><!-- wp:group {\"layout\":{\"type\":\"constrained\",\"contentSize\":\"100%\"}} -->\n<div class=\"wp-block-group\"><!-- wp:heading {\"level\":6} -->\n<h6 class=\"wp-block-heading\"><strong><strong>Email</strong></strong></h6>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"fontSize\":\"small\",\"fontFamily\":\"work-sans\"} -->\n<p class=\"has-work-sans-font-family has-small-font-size\">desicarola@gmail.com</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:group --></div>\n<!-- /wp:group --></div>\n<!-- /wp:column -->\n\n<!-- wp:column {\"width\":\"100%\"} -->\n<div class=\"wp-block-column\" style=\"flex-basis:100%\"><!-- wp:group {\"layout\":{\"type\":\"constrained\",\"contentSize\":\"100%\"}} -->\n<div class=\"wp-block-group\"><!-- wp:group {\"layout\":{\"type\":\"constrained\",\"contentSize\":\"100%\"}} -->\n<div class=\"wp-block-group\"><!-- wp:heading {\"level\":5} -->\n<h5 class=\"wp-block-heading\"><strong><strong>Phone no.</strong></strong></h5>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"fontSize\":\"small\",\"fontFamily\":\"work-sans\"} -->\n<p class=\"has-work-sans-font-family has-small-font-size\">+1 407 576 5117</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:group --></div>\n<!-- /wp:group --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:social-links {\"iconColor\":\"primary\",\"iconColorValue\":\"#000\",\"size\":\"has-large-icon-size\",\"style\":{\"spacing\":{\"margin\":{\"top\":\"var:preset|spacing|50\",\"bottom\":\"var:preset|spacing|50\"}}},\"className\":\"is-style-logos-only\",\"layout\":{\"type\":\"flex\",\"justifyContent\":\"left\",\"orientation\":\"horizontal\"}} -->\n<ul class=\"wp-block-social-links has-large-icon-size has-icon-color is-style-logos-only\" style=\"margin-top:var(--wp--preset--spacing--50);margin-bottom:var(--wp--preset--spacing--50)\"><!-- wp:social-link {\"url\":\"#\",\"service\":\"facebook\"} /-->\n\n<!-- wp:social-link {\"url\":\"#\",\"service\":\"linkedin\"} /-->\n\n<!-- wp:social-link {\"url\":\"#\",\"service\":\"twitter\"} /--></ul>\n<!-- /wp:social-links -->\n\n<!-- wp:buttons {\"layout\":{\"type\":\"flex\",\"justifyContent\":\"left\"},\"style\":{\"spacing\":{\"blockGap\":\"var:preset|spacing|30\",\"margin\":{\"top\":\"var:preset|spacing|50\",\"bottom\":\"var:preset|spacing|50\"}}}} -->\n<div class=\"wp-block-buttons\" style=\"margin-top:var(--wp--preset--spacing--50);margin-bottom:var(--wp--preset--spacing--50)\"><!-- wp:button {\"backgroundColor\":\"background-alt\",\"textColor\":\"heading-color\",\"style\":{\"border\":{\"radius\":\"4px\"},\"spacing\":{\"padding\":{\"top\":\"1.2rem\",\"bottom\":\"1.2rem\",\"left\":\"var:preset|spacing|50\",\"right\":\"var:preset|spacing|50\"}}},\"className\":\"is-style-fill\",\"fontSize\":\"small\",\"fontFamily\":\"work-sans\"} -->\n<div class=\"wp-block-button has-custom-font-size is-style-fill has-work-sans-font-family has-small-font-size\"><a class=\"wp-block-button__link has-heading-color-color has-background-alt-background-color has-text-color has-background wp-element-button\" style=\"border-radius:4px;padding-top:1.2rem;padding-right:var(--wp--preset--spacing--50);padding-bottom:1.2rem;padding-left:var(--wp--preset--spacing--50)\">Got a Project?</a></div>\n<!-- /wp:button -->\n\n<!-- wp:button {\"textColor\":\"primary\",\"style\":{\"spacing\":{\"padding\":{\"top\":\"1rem\",\"bottom\":\"1rem\",\"left\":\"var:preset|spacing|50\",\"right\":\"var:preset|spacing|50\"}},\"border\":{\"radius\":\"4px\"}},\"className\":\"is-style-outline\",\"fontSize\":\"small\",\"fontFamily\":\"work-sans\"} -->\n<div class=\"wp-block-button has-custom-font-size is-style-outline has-work-sans-font-family has-small-font-size\"><a class=\"wp-block-button__link has-primary-color has-text-color wp-element-button\" style=\"border-radius:4px;padding-top:1rem;padding-right:var(--wp--preset--spacing--50);padding-bottom:1rem;padding-left:var(--wp--preset--spacing--50)\">Lets talk</a></div>\n<!-- /wp:button --></div>\n<!-- /wp:buttons --></div>\n<!-- /wp:column -->\n\n<!-- wp:column {\"style\":{\"spacing\":{\"padding\":{\"top\":\"0\",\"right\":\"0\",\"bottom\":\"0\",\"left\":\"0\"}}}} -->\n<div class=\"wp-block-column\" style=\"padding-top:0;padding-right:0;padding-bottom:0;padding-left:0\"><!-- wp:image {\"id\":273,\"sizeSlug\":\"full\",\"linkDestination\":\"none\",\"className\":\"is-style-default\"} -->\n<figure class=\"wp-block-image size-full is-style-default\"><img src=\"http://desiree-villasmil.local/wp-content/themes/keily/assets/images/hero.png\" alt=\"\" class=\"wp-image-273\"/></figure>\n<!-- /wp:image --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns --></div>\n<!-- /wp:group --></main>\n<!-- /wp:group -->\n\n<!-- wp:group {\"tagName\":\"main\",\"style\":{\"spacing\":{\"padding\":{\"top\":\"var:preset|spacing|80\",\"right\":\"var:preset|spacing|20\",\"bottom\":\"var:preset|spacing|80\",\"left\":\"var:preset|spacing|20\"},\"margin\":{\"top\":\"0\",\"bottom\":\"0\"}}},\"layout\":{\"type\":\"constrained\",\"contentSize\":\"1320px\",\"wideSize\":\"100%\"}} -->\n<main class=\"wp-block-group\" style=\"margin-top:0;margin-bottom:0;padding-top:var(--wp--preset--spacing--80);padding-right:var(--wp--preset--spacing--20);padding-bottom:var(--wp--preset--spacing--80);padding-left:var(--wp--preset--spacing--20)\"><!-- wp:columns {\"verticalAlignment\":\"center\"} -->\n<div class=\"wp-block-columns are-vertically-aligned-center\"><!-- wp:column {\"verticalAlignment\":\"center\",\"width\":\"\",\"style\":{\"spacing\":{\"padding\":{\"right\":\"var:preset|spacing|80\"}}}} -->\n<div class=\"wp-block-column is-vertically-aligned-center\" style=\"padding-right:var(--wp--preset--spacing--80)\"><!-- wp:heading {\"textAlign\":\"left\",\"level\":5,\"style\":{\"typography\":{\"textTransform\":\"uppercase\"}},\"fontSize\":\"medium\"} -->\n<h5 class=\"wp-block-heading has-text-align-left has-medium-font-size\" style=\"text-transform:uppercase\">- About me</h5>\n<!-- /wp:heading -->\n\n<!-- wp:heading {\"textAlign\":\"left\",\"level\":1,\"fontSize\":\"xxx-large\"} -->\n<h1 class=\"wp-block-heading has-text-align-left has-xxx-large-font-size\">WELCOME TO...</h1>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"align\":\"left\",\"style\":{\"spacing\":{\"padding\":{\"top\":\"var:preset|spacing|30\",\"right\":\"var:preset|spacing|30\",\"bottom\":\"var:preset|spacing|50\",\"left\":\"var:preset|spacing|30\"}},\"typography\":{\"lineHeight\":\"1.7\",\"fontSize\":\"1.3rem\"}},\"fontFamily\":\"work-sans\"} -->\n<p class=\"has-text-align-left has-work-sans-font-family\" style=\"padding-top:var(--wp--preset--spacing--30);padding-right:var(--wp--preset--spacing--30);padding-bottom:var(--wp--preset--spacing--50);padding-left:var(--wp--preset--spacing--30);font-size:1.3rem;line-height:1.7\">I\'m from Caracas Venezuela and I live with my husband and my daughter in Florida since 2018. I love lis