}},\"fontFamily\":\"work-sans\"} -->\n<p class=\"has-work-sans-font-family\" style=\"font-size:1.4rem;line-height:1.5\">Orlando, Florida</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:group --></div>\n<!-- /wp:group --></div>\n<!-- /wp:column -->\n\n<!-- wp:column {\"verticalAlignment\":\"center\",\"width\":\"50%\"} -->\n<div class=\"wp-block-column is-vertically-aligned-center\" style=\"flex-basis:50%\"><!-- wp:group {\"style\":{\"spacing\":{\"padding\":{\"top\":\"var:preset|spacing|60\",\"right\":\"var:preset|spacing|60\",\"bottom\":\"var:preset|spacing|60\",\"left\":\"var:preset|spacing|60\"}},\"border\":{\"radius\":\"8px\"}},\"backgroundColor\":\"white\",\"layout\":{\"type\":\"constrained\"}} -->\n<div class=\"wp-block-group has-white-background-color has-background\" style=\"border-radius:8px;padding-top:var(--wp--preset--spacing--60);padding-right:var(--wp--preset--spacing--60);padding-bottom:var(--wp--preset--spacing--60);padding-left:var(--wp--preset--spacing--60)\"><!-- wp:shortcode -->\n[contact-form-7 id=\"362\" title=\"Contact form 1\"]\n<!-- /wp:shortcode --></div>\n<!-- /wp:group --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns --></div>\n<!-- /wp:group -->\n\n<!-- wp:template-part {\"slug\":\"footer\",\"theme\":\"keily\"} /-->','Front Page','Displays your site\'s homepage, whether it is set to display latest posts or a static page. The Front Page template takes precedence over all templates.','publish','closed','closed','','front-page','','','2023-09-03 19:47:34','2023-09-03 19:47:34','',0,'http://desiree-villasmil.local/front-page/',0,'wp_template','',0);
INSERT INTO `wp_posts` VALUES (12,1,'2023-09-02 19:02:46','2023-09-02 19:02:46','<!-- wp:paragraph -->\n<p>I\'ve been a developer for over 10 years now, and I\'ve learned a lot along the way. I\'ve seen the industry change a lot in that time, and I\'ve had to adapt my skills to keep up.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>One of the most important things I\'ve learned is that you never stop learning. The field of software development is constantly evolving, and there are always new technologies to learn. If you want to stay ahead of the curve, you need to be willing to learn new things.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Another important thing I\'ve learned is that it\'s important to be adaptable. The way we develop software has changed a lot in the past few years. We used to work on monolithic applications, but now we\'re more likely to work on microservices. We used to write code in a linear fashion, but now we\'re more likely to use agile development methodologies. If you want to be successful as a developer, you need to be able to adapt to change.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>I\'ve also learned that it\'s important to be a good communicator. As a developer, you\'ll need to communicate with other developers, product managers, and even non-technical stakeholders. If you can\'t communicate effectively, you\'ll have a hard time getting your work done.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Finally, I\'ve learned that it\'s important to be passionate about what you do. If you\'re not passionate about software development, it will be hard to stay motivated. There will be times when you\'re frustrated and tired, but if you\'re passionate about what you do, you\'ll be able to push through those times.</p>\n<!-- /wp:paragraph -->','Journal of an Experienced Developer...','','inherit','closed','closed','','1-revision-v1','','','2023-09-02 19:02:46','2023-09-02 19:02:46','',1,'http://desiree-villasmil.local/?p=12',0,'revision','',0);
