m excited about the opportunity to join your team, and I would be happy to discuss how I can help the company with my skills and experience. Thank you for considering my profile. I look forward to hearing from you soon.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:group {\"style\":{\"spacing\":{\"blockGap\":\"var:preset|spacing|30\",\"margin\":{\"top\":\"var:preset|spacing|60\"}}},\"layout\":{\"type\":\"flex\",\"orientation\":\"vertical\"}} -->\n<div class=\"wp-block-group\" style=\"margin-top:var(--wp--preset--spacing--60)\"><!-- wp:list {\"style\":{\"spacing\":{\"padding\":{\"top\":\"0\",\"right\":\"0\",\"bottom\":\"0\",\"left\":\"0\"}}},\"className\":\"is-style-list-style-no-bullet\"} -->\n<ul class=\"is-style-list-style-no-bullet\" style=\"padding-top:0;padding-right:0;padding-bottom:0;padding-left:0\"><!-- wp:list-item {\"style\":{\"typography\":{\"fontSize\":\"18px\"}}} -->\n<li style=\"font-size:18px\"><a href=\"#\">Orlando, FL</a></li>\n<!-- /wp:list-item --></ul>\n<!-- /wp:list -->\n\n<!-- wp:list {\"style\":{\"spacing\":{\"padding\":{\"top\":\"0\",\"right\":\"0\",\"bottom\":\"0\",\"left\":\"0\"}}},\"className\":\"is-style-list-style-no-bullet\"} -->\n<ul class=\"is-style-list-style-no-bullet\" style=\"padding-top:0;padding-right:0;padding-bottom:0;padding-left:0\"><!-- wp:list-item {\"style\":{\"typography\":{\"fontSize\":\"18px\"}}} -->\n<li style=\"font-size:18px\"><a href=\"#\">+1 (407) 576-5117</a></li>\n<!-- /wp:list-item --></ul>\n<!-- /wp:list -->\n\n<!-- wp:list {\"style\":{\"spacing\":{\"padding\":{\"top\":\"0\",\"right\":\"0\",\"bottom\":\"0\",\"left\":\"0\"}}},\"className\":\"is-style-list-style-no-bullet\"} -->\n<ul class=\"is-style-list-style-no-bullet\" style=\"padding-top:0;padding-right:0;padding-bottom:0;padding-left:0\"><!-- wp:list-item {\"style\":{\"typography\":{\"fontSize\":\"18px\"}}} -->\n<li style=\"font-size:18px\"><a href=\"#\">desicarola@gmail.com</a></li>\n<!-- /wp:list-item --></ul>\n<!-- /wp:list --></div>\n<!-- /wp:group --></div>\n<!-- /wp:group --></div>\n<!-- /wp:column -->\n\n<!-- wp:column {\"verticalAlignment\":\"center\",\"width\":\"50%\"} -->\n<div class=\"wp-block-column is-vertically-aligned-center\" style=\"flex-basis:50%\"><!-- wp:group {\"style\":{\"spacing\":{\"padding\":{\"top\":\"var:preset|spacing|60\",\"right\":\"var:preset|spacing|60\",\"bottom\":\"var:preset|spacing|60\",\"left\":\"var:preset|spacing|60\"}},\"border\":{\"radius\":\"8px\"}},\"backgroundColor\":\"white\",\"layout\":{\"type\":\"constrained\"}} -->\n<div class=\"wp-block-group has-white-background-color has-background\" style=\"border-radius:8px;padding-top:var(--wp--preset--spacing--60);padding-right:var(--wp--preset--spacing--60);padding-bottom:var(--wp--preset--spacing--60);padding-left:var(--wp--preset--spacing--60)\"><!-- wp:shortcode -->\n[contact-form-7 id=\"362\" title=\"Contact form 1\"]\n<!-- /wp:shortcode --></div>\n<!-- /wp:group --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns --></div>\n<!-- /wp:group --></div>\n<!-- /wp:group --></div>\n<!-- /wp:group --></div>\n<!-- /wp:group -->','Contact','','publish','closed','closed','','contact','','','2023-09-06 19:47:00','2023-09-06 19:47:00','',0,'http://desiree-villasmil.local/?page_id=41',0,'page','',0);
INSERT INTO `wp_posts` VALUES (42,1,'2023-09-06 02:32:05','2023-09-06 02:32:05','<!-- wp:contact-form-7/contact-form-selector {\"id\":18,\"hash\":\"e5999f5\",\"title\":\"Contact form 1\"} -->\n<div class=\"wp-block-contact-form-7-contact-form-selector\">[contact-form-7 id=\"e5999f5\" title=\"Contact form 1\"]</div>\n<!-- /wp:contact-form-7/contact-form-selector -->','Contact','','inherit','closed','closed','','41-revision-v1','','','2023-09-06 02:32:05','2023-09-06 02:32:05','',41,'http://desiree-villasmil.local/?p=42',0,'revision','',0);
INSERT INTO `wp_posts` VALUES (43,1,'2023-09-06 02:36:50','2023-09-06 02:36:50','<!-- wp:paragraph -->\n<p>I’ve been a developer for over 10 years now, and I’ve learned a lot along the way. I’ve seen the industry change a lot in that time, and I’ve had to adapt my skills to keep up.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"backgroundColor\":\"tertiary-light\"} -->\n<p class=\"has-tertiary-light-background-color has-background\"><strong>One of the most important things I’ve learned is that you never stop learning.</strong> The field of software development is constantly evolving, and there are always new technologies to learn. If you want to stay ahead of the curve, you need to be willing to learn new things.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Another important thing I’ve learned is that it’s important to be adaptable. The way we develop software has changed a lot in the past few years. We used to work on monolithic applications, but now we’re more likely to work on microservices. We used to write code in a linear fashion, but now we’re more likely to use agile development methodologies. If you want to be successful as a developer, you need to be able to adapt to change.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>I’ve also learned that it’s important to be a good communicator. As a developer, you’ll need to communicate with other developers, product managers, and even non-technical stakeholders. If you can’t communicate effectively, you’ll have a hard time getting your work done.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Finally, I’ve learned that it’s important to be passionate about what you do. If you’re not passionate about software development, it will be hard to stay motivated. There will be times when you’re frustrated and tired, but if you’re passionate about what you do, you’ll be able to push through those times.</p>\n<!-- /wp:paragraph -->','Journal of an Experienced Developer…','','publish','closed','closed','','journal','','','2023-09-07 01:35:18','2023-09-07 01:35:18','',0,'http://desiree-villasmil.local/?page_id=43',0,'page','',0);
INSERT INTO `wp_posts` VALUES (44,1,'2023-09-06 02:36:50','2023-09-06 02:36:50','<!-- wp:paragraph -->\n<p>I’ve been a developer for over 10 years now, and I’ve learned a lot along the way. I’ve seen the industry change a lot in that time, and I’ve had to adapt my skills to keep up.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>One of the most important things I’ve learned is that you never stop learning. The field of software development is constantly evolving, and there are always new technologies to learn. If you want to stay ahead of the curve, you need to be willing to learn new things.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Another important thing I’ve learned is that it’s important to be adaptable. The way we develop software has changed a lot in the past few years. We used to work on monolithic applications, but now we’re more likely to work on microservices. We used to write code in a linear fashion, but now we’re more likely to use agile development methodologies. If you want to be successful as a developer, you need to be able to adapt to change.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>I’ve also learned that it’s important to be a good communicator. As a developer, you’ll need to communicate with other developers, product managers, and even non-technical stakeholders. If you can’t communicate effectively, you’ll have a hard time getting your work done.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Finally, I’ve learned that it’s important to be passionate about what you do. If you’re not passionate about software development, it will be hard to stay motivated. There will be times when you’re frustrated and tired, but if you’re passionate about what you do, you’ll be able to push through those times.</p>\n<!-- /wp:paragraph -->','Journal of an Experienced Developer…','','inherit','closed','closed','','43-revision-v1','','','2023-09-06 02:36:50','2023-09-06 02:36:50','',43,'http://desiree-villasmil.local/?p=44',0,'revision','',0);
