\":{\"padding\":{\"top\":\"0\",\"right\":\"0\",\"bottom\":\"0\",\"left\":\"0\"}}},\"className\":\"is-style-default\"} -->\n<div class=\"wp-block-column is-style-default\" style=\"border-style:none;border-width:0px;padding-top:0;padding-right:0;padding-bottom:0;padding-left:0\"><!-- wp:group {\"style\":{\"spacing\":{\"padding\":{\"top\":\"var:preset|spacing|70\",\"right\":\"var:preset|spacing|60\",\"bottom\":\"var:preset|spacing|70\",\"left\":\"var:preset|spacing|60\"}},\"border\":{\"radius\":\"10px\",\"width\":\"1px\"}},\"borderColor\":\"border-color\",\"backgroundColor\":\"background\",\"className\":\"is-style-fotawp-boxshadow\",\"layout\":{\"type\":\"constrained\"}} -->\n<div class=\"wp-block-group is-style-fotawp-boxshadow has-border-color has-border-color-border-color has-background-background-color has-background\" style=\"border-width:1px;border-radius:10px;padding-top:var(--wp--preset--spacing--70);padding-right:var(--wp--preset--spacing--60);padding-bottom:var(--wp--preset--spacing--70);padding-left:var(--wp--preset--spacing--60)\"><!-- wp:image {\"align\":\"center\",\"id\":164,\"sizeSlug\":\"full\",\"linkDestination\":\"none\",\"style\":{\"color\":{\"duotone\":\"var:preset|duotone|primary\"}},\"className\":\"fotawp-duotone-primary\"} -->\n<figure class=\"wp-block-image aligncenter size-full fotawp-duotone-primary\"><img src=\"http://desiree-villasmil.local/wp-content/themes/fotawp/assets/images/icon_pagebuilder.svg\" alt=\"\" class=\"wp-image-164\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:heading {\"textAlign\":\"center\",\"level\":4,\"style\":{\"spacing\":{\"margin\":{\"top\":\"var:preset|spacing|40\"}},\"typography\":{\"fontStyle\":\"normal\",\"fontWeight\":\"600\"}},\"textColor\":\"heading-color\",\"fontSize\":\"medium\"} -->\n<h4 class=\"wp-block-heading has-text-align-center has-heading-color-color has-text-color has-medium-font-size\" style=\"margin-top:var(--wp--preset--spacing--40);font-style:normal;font-weight:600\">Data Base</h4>\n<!-- /wp:headin