div>\n<!-- /wp:column --></div>\n<!-- /wp:columns --></div>\n<!-- /wp:group --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:columns {\"style\":{\"spacing\":{\"margin\":{\"top\":\"var:preset|spacing|70\"},\"blockGap\":{\"top\":\"var:preset|spacing|60\",\"left\":\"var:preset|spacing|60\"}}}} -->\n<div class=\"wp-block-columns\" style=\"margin-top:var(--wp--preset--spacing--70)\"><!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:group {\"style\":{\"border\":{\"radius\":\"10px\"},\"spacing\":{\"padding\":{\"top\":\"var:preset|spacing|60\",\"right\":\"var:preset|spacing|60\",\"bottom\":\"var:preset|spacing|60\",\"left\":\"var:preset|spacing|60\"},\"blockGap\":\"var:preset|spacing|20\"}},\"backgroundColor\":\"foregound-alt\",\"layout\":{\"type\":\"constrained\"}} -->\n<div class=\"wp-block-group has-foregound-alt-background-color has-background\" style=\"border-radius:10px;padding-top:var(--wp--preset--spacing--60);padding-right:var(--wp--preset--spacing--60);padding-bottom:var(--wp--preset--spacing--60);padding-left:var(--wp--preset--spacing--60)\"><!-- wp:heading {\"level\":5,\"style\":{\"typography\":{\"fontSize\":\"2em\"}}} -->\n<h5 class=\"wp-block-heading\" style=\"font-size:2em\">Correlation One</h5>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Software Development Training Program</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"style\":{\"typography\":{\"fontSize\":\"1em\"}}} -->\n<p style=\"font-size:1em\">Participated in a 17-week Software Development training in partnership with Amazon Career Choice with learning facilitated through Codio using Advanced HTML/CSS, UI/UX.<br>Design, and Javascript Frameworks<br>Solved case-based, business problems using real-world data<br>Developed full-stack data fluency</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:spacer {\"height\":\"10px\"} -->\n<div style=\"height:10px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n<!-- /wp:spacer --></div>\n<!-- /wp:group --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:group {\"style\":{\"border\":{\"radius\":\"10px\"},\"spacing\":{\"padding\":{\"top\":\"var:preset|spacing|60\",\"right\":\"var:preset|spacing|60\",\"bottom\":\"var:preset|spacing|60\",\"left\":\"var:preset|spacing|60\"},\"blockGap\":\"var:preset|spacing|20\"}},\"backgroundColor\":\"foregound-alt\",\"layout\":{\"type\":\"constrained\"}} -->\n<div class=\"wp-block-group has-foregound-alt-background-color has-background\" style=\"border-radius:10px;padding-top:var(--wp--preset--spacing--60);padding-right:var(--wp--preset--spacing--60);padding-bottom:var(--wp--preset--spacing--60);padding-left:var(--wp--preset--spacing--60)\"><!-- wp:heading {\"level\":5,\"style\":{\"typography\":{\"fontSize\":\"2em\"}}} -->\n<h5 class=\"wp-block-heading\" style=\"font-size:2em\">Amazon</h5>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Fulfillment Associate L1</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"style\":{\"typography\":{\"fontSize\":\"1em\"}}} -->\n<p style=\"font-size:1em\">Communicate with team members and supervisors to meet daily packaging goals while maintaining a high level of accuracy, ranking among the top 7 percentile in productivity.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:spacer {\"height\":\"10px\"} -->\n<div style=\"height:10px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n<!-- /wp:spacer --></div>\n<!-- /wp:group --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:columns {\"style\":{\"spacing\":{\"margin\":{\"top\":\"var:preset|spacing|60\"},\"blockGap\":{\"top\":\"var:preset|spacing|60\",\"left\":\"var:preset|spacing|60\"}}}} -->\n<div class=\"wp-block-columns\" style=\"margin-top:var(--wp--preset--spacing--60)\"><!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:group {\"style\":{\"border\":{\"radius\":\"10px\"},\"spacing\":{\"padding\":{\"top\":\"var:preset|spacing|60\",\"right\":\"var:preset|spacing|60\",\"bottom\":\"var:preset|spacing|60\",\"left\":\"var:preset|spacing|60\"},\"blockGap\":\"var:preset|spacing|20\"}},\"backgroundColor\":\"foregound-alt\",\"layout\":{\"type\":\"constrained\"}} -->\n<div class=\"wp-block-group has-foregound-alt-background-color has-background\" style=\"border-radius:10px;padding-top:var(--wp--preset--spacing--60);padding-right:var(--wp--preset--spacing--60);padding-bottom:var(--wp--preset--spacing--60);padding-left:var(--wp--preset--spacing--60)\"><!-- wp:heading {\"level\":5,\"style\":{\"typography\":{\"fontSize\":\"2em\"}}} -->\n<h5 class=\"wp-block-heading\" style=\"font-size:2em\">Zonagps.com</h5>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Mobile Application Developer</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"style\":{\"typography\":{\"lineHeight\":\"1.3\",\"fontSize\":\"1em\"}}} -->\n<p style=\"font-size:1em;line-height:1.3\">Develop a user-friendly interface that allows users to control and manage transport fleets using their mobile devices.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"style\":{\"typography\":{\"lineHeight\":\"1.6\",\"fontSize\":\"1em\"}}} -->\n<p style=\"font-size:1em;line-height:1.6\">Implement features such to see the real-time position of the vehicle fleet and be able to turn on or off a particular vehicle, which increased the sale of the service by 12%.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:spacer {\"height\":\"10px\"} -->\n<div style=\"height:10px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n<!-- /wp:spacer --></div>\n<!-- /wp:group --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:group {\"style\":{\"border\":{\"radius\":\"10px\"},\"spacing\":{\"padding\":{\"top\":\"var:preset|spacing|60\",\"right\":\"var:preset|spacing|60\",\"bottom\":\"var:preset|spacing|60\",\"left\":\"var:preset|spacing|60\"},\"blockGap\":\"var:preset|spacing|20\"}},\"backgroundColor\":\"foregound-alt\",\"layout\":{\"type\":\"constrained\"}} -->\n<div class=\"wp-block-group has-foregound-alt-background-color has-background\" style=\"border-radius:10px;padding-top:var(--wp--preset--spacing--60);padding-right:var(--wp--preset--spacing--60);padding-bottom:var(--wp--preset--spacing--60);padding-left:var(--wp--preset--spacing--60)\"><!-- wp:heading {\"level\":5,\"style\":{\"typography\":{\"fontSize\":\"2em\"}}} -->\n<h5 class=\"wp-block-heading\" style=\"font-size:2em\">Rumcalmar</h5>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Web Architect</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"style\":{\"typography\":{\"fontSize\":\"1em\"}}} -->\n<p style=\"font-size:1em\">Developed and ran an innovative website using HTML and CSS on the front-end and CGI with RPG technologies on the back-end, reducing human error by more than 70%.<br>Designed scalable and efficient database structures in DB2 for AS-400.<br></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:spacer {\"height\":\"10px\"} -->\n<div style=\"height:10px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n<!-- /wp:spacer --></div>\n<!-- /wp:group --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns --></div>\n<!-- /wp:group --></main>\n<!-- /wp:group -->','Everything about me!','','inherit','closed','closed','','82-revision-v1','','','2023-09-06 23:33:41','2023-09-06 23:33:41','',82,'http://desiree-villasmil.local/?p=117',0,'revision','',0);
